Calculating AI (Artificial Intelligence) is a broad concept, but I'll provide you with an example of calculating the score of a simple artificial intelligence system using the A* search algorithm in C#. This algorithm is used for pathfinding and graph traversal.

**A\* Search Algorithm Example**
```csharp`
using System;
using System.Collections.Generic;

public class Node : IComparable<Node>
{
    public int X { get; set; }
    public int Y { get; set; }
    public int Cost { get; set; }
    public Node Parent { get; set; }

    public int CompareTo(Node other)
    {
        return this.Cost.CompareTo(other.Cost);
    }
}

public class AStarSearchAlgorithm<T> where T : Node, new()
{
    private int[,] _grid;
    private Dictionary<Node, int> _gScore = new Dictionary<Node, int>();
    private Dictionary<Node, int> _fScore = new Dictionary<Node, int>();
    private SortedSet<Node> _openSet = new SortedSet<Node>();

    public AStarSearchAlgorithm(int[,] grid)
    {
        _grid = grid;
    }

    public List<Node> FindPath(T start, T goal)
    {
        var current = start;
        while (!IsGoal(current, goal))
        {
            foreach (var neighbor in GetNeighbors(current))
            {
                if (!_gScore.ContainsKey(neighbor))
                    _gScore[neighbor] = int.MaxValue;
                var tentativeGScore = _gScore[current] + neighbor.Cost;
                if (tentativeGScore < _gScore[neighbor])
                {
                    neighbor.Parent = current;
                    _gScore[neighbor] = tentativeGScore;
                    _fScore[neighbor] = tentativeGScore + Heuristic(neighbor, goal);
                    if (!_openSet.Contains(neighbor))
                        _openSet.Add(neighbor);
                }
            }

            current = _openSet.Min;
            _openSet.Remove(current);
        }

        var path = new List<Node>();
        while (current!= null)
        {
            path.Add(current);
            current = current.Parent;
        }

        path.Reverse();
        return path;
    }

    private bool IsGoal(Node node, Node goal)
    {
        return node.X == goal.X && node.Y == goal.Y;
    }

    private IEnumerable<Node> GetNeighbors(Node node)
    {
        yield return new Node { X = node.X - 1, Y = node.Y }; // Left neighbor (cost: 1)
        yield return new Node { X = node.X + 1, Y = node.Y }; // Right neighbor (cost: 1)
        yield return new Node { X = node.X, Y = node.Y - 1 }; // Top neighbor (cost: 1)
        yield return new Node { X = node.X, Y = node.Y + 1 }; // Bottom neighbor (cost: 1)

        // Diagonal neighbors (cost: âˆš2 â‰ˆ 1.41)
        yield return new Node { X = node.X - 1, Y = node.Y - 1 };
        yield return new Node { X = node.X + 1, Y = node.Y - 1 };
        yield return new Node { X = node.X - 1, Y = node.Y + 1 };
        yield return new Node { X = node.X + 1, Y = node.Y + 1 };
    }

    private int Heuristic(Node node, Node goal)
    {
        // Manhattan distance heuristic (L1 norm)
        return Math.Abs(node.X - goal.X) + Math.Abs(node.Y - goal.Y);
    }
}
```
This implementation provides a basic A\* search algorithm that can be used to find the shortest path between two nodes on a grid.

To round a `double` value to two decimal places in C, you can use the `round()` function from the `math.h` library along with multiplication and division by 100.

Here's how you can achieve it:

```csharp is not supported but c code is 
#include <stdio.h>
#include <math.h>

int main() {
    double number = 10.5678;

    // Round the number to two decimal places using rounding, multiplying, then dividing.
    double rounded_number = round(number * 100) / 100;

    printf("The rounded number is: %.2f\n", rounded_number);

    return 0;
}
```

This method works as follows:
- Multiply the number by 100 (which shifts the decimal point two positions to the right), converting 10.5678 to 1056.78.
- Apply `round()` on this product, which rounds 1056.78 to 1056.78.
- Divide the result of the rounding operation by 100 to shift the decimal point back to its original position, giving you 10.57, effectively rounding the original number to two decimal places.

Please note that `round()` uses the current rounding direction (initially to nearest even, which means if the digit before the ones place being removed (in case we were rounding after the ones place for example would be an even number) is even, the digit to keep gets replaced with an "even" number otherwise, the last digit in the part of the number to keep becomes one greater then its prior state).
